import React from "react";
import TopNav from "../componenets/TopNav";
import no_icon from "../assets/non_icon.png";
import x_icon from "../assets/X_Icon.png";
import MainNav from "../componenets/MainNav";

const ChangePasswordButton = () => {
  const handleClick = () => {
    // 비밀번호 변경 로직을 여기에 작성하시면 됩니다.
  };

  return <button onClick={handleClick}>비밀번호 변경하기</button>;
};

const LogoutButton = () => {
  const handleClick = () => {
    // 로그아웃 로직을 여기에 작성하시면 됩니다.
  };

  return <button onClick={handleClick}>로그아웃</button>;
};

const DeleteAccountButton = () => {
  const handleClick = () => {
    // 계정 탈퇴 로직을 여기에 작성하시면 됩니다.
  };

  return <button onClick={handleClick}>탈퇴하기</button>;
};

function PersonalPage(props) {
  return (
    <div>
      <h1>personal</h1>
      <TopNav
        text="개인/보안"
        link1={undefined}
        link2="/setting"
        icon1={no_icon}
        icon2={x_icon}
      />

      <ChangePasswordButton />
      <LogoutButton />
      <DeleteAccountButton />

      <MainNav />
    </div>
  );
}

export default PersonalPage;
